import logo from './logo-1.png';
import './App.css';
import geopossition from './geopossition.png';
import time from './time.png';


function App() {
  return (
    <div className="NavBar">
      <img src={logo} alt="logo" className="Logo-1"/>
      <ul className="Top-bar"> 

      <img src={geopossition} className="Geoposs"/><li className="Address">г. Москва, ул. Вешних вод, 4с170</li>
      <img src={time} className="Time"/><li className="Works">Пн-Вс 10.00 - 21.00</li>
      <div className="Social">


      </div>

      </ul>
    </div>
  );
}

export default App;
